import React, { useEffect, useState } from "react";
import "../css/UpdateTicket.css";
import { getTicketById, updateTicket } from "../api/Ticket_API";
function UpdateTicket(props) {

  const [updatedTicketData , setUpdatedTicket] = useState({
    status:"",
    content:""
  });

  const handleChange=(e)=>{
    console.log(e.target.name);
    setUpdatedTicket({...updatedTicketData,[e.target.name]:e.target.value});
  }

  const handleSubmit=(e)=>{
    e.preventDefault();
    console.log(updatedTicketData)
    updateTicket(props.singleTicket.ticketId,updatedTicketData).then(resp=>{
      props.setSingleTicket(resp.data);
    })
  }
  return (
    <div className="modal">
      <div
        className="overlay"
        onClick={() => {
          props.setUpdate(false);
        }}
      ></div>
      <div className="view-detail-modal">
        <div className="header">
          <span>Update Ticket</span>
        </div>
        <div className="parent-div">
          <div className="left">
            <div className="left-parent">
              <div className="ticketdata">
                <h3>Ticket Name:</h3>
                <p>{props.singleTicket.ticketName}</p>
              </div>

              <div className="ticketdata">
                <h3>Ticket Description:</h3>
                <textarea id="ticket-des" placeholder={props.singleTicket.description} disabled/>
              </div>

              <div className="ticketdata">
                <h3>Created By:</h3>
                <p>{props.singleTicket.creationDate}</p>
              </div>

              <div className="ticketdata">
                <h3>Assigned to:</h3>
                <p>{props.singleTicket.department.depName}</p>
              </div>

              <div className="ticketdata">
                <h3>Status:</h3>
                <select name='status' defaultValue={props.singleTicket.status} onChange={handleChange}>
                
                  <option key="OPEN" value="OPEN">
                    OPEN
                  </option>
                  <option key="BEING_ADDRESSED" value="BEING_ADDRESSED">
                    BEING_ADDRESSED
                  </option>
                  <option key="RESOLVED" value="RESOLVED">
                    CLOSED
                  </option>
                </select>
              </div>

              <div className="ticketdata">
                <textarea name='content' value={updatedTicketData.content} placeholder="Enter your Comment" onChange={handleChange}/>
              </div>
            </div>
          </div>
          <div className="right">
            <div className="comment">
              {props.singleTicket.comments.map((m) => {
                return (
                  <div className="comment-content">
                    <h3>{m.empName}</h3>
                    <p>{m.content}</p>
                  </div>
              );
              })}
            </div>
          </div>
        </div>
        <div className="button-update">
          <button onClick={handleSubmit}>Update</button>
        </div>
      </div>
    </div>
  );
}

export default UpdateTicket;
